    private final Matrix mPreviousTransform = new Matrix();

    private final Matrix mActiveTransform = new Matrix();

    private final Matrix mActiveTransformInverse = new Matrix();

    private final float[] mTempValues = new float[9];

    private final RectF mTempRect = new RectF();

    private boolean mWasTransformCorrected;

    public static DefaultZoomableController newInstance() {
        return new DefaultZoomableController(TransformGestureDetector.newInstance());
    }

    public DefaultZoomableController(TransformGestureDetector gestureDetector) {
        if (!ListenerUtil.mutListener.listen(7837)) {
            mGestureDetector = gestureDetector;
        }
        if (!ListenerUtil.mutListener.listen(7838)) {
            mGestureDetector.setListener(this);
        }
    }

    /**
     * Rests the controller.
     */
    public void reset() {
        if (!ListenerUtil.mutListener.listen(7839)) {
            FLog.v(TAG, "reset");
        }
        if (!ListenerUtil.mutListener.listen(7840)) {
            mGestureDetector.reset();
        }
        if (!ListenerUtil.mutListener.listen(7841)) {
            mPreviousTransform.reset();
        }
        if (!ListenerUtil.mutListener.listen(7842)) {
            mActiveTransform.reset();
        }
        if (!ListenerUtil.mutListener.listen(7843)) {
            onTransformChanged();
        }
    }

    /**
     * Sets the zoomable listener.
     */
    @Override
    public void setListener(Listener listener) {
        if (!ListenerUtil.mutListener.listen(7844)) {
            mListener = listener;
        }
    }

    /**
     * Sets whether the controller is enabled or not.
     */
    @Override
    public void setEnabled(boolean enabled) {
        if (!ListenerUtil.mutListener.listen(7845)) {
            mIsEnabled = enabled;
        }
        if (!ListenerUtil.mutListener.listen(7847)) {
            if (!enabled) {
                if (!ListenerUtil.mutListener.listen(7846)) {
                    reset();
                }
            }
        }
    }

    /**
     * Gets whether the controller is enabled or not.
     */
    @Override
    public boolean isEnabled() {
        return mIsEnabled;
    }

    /**
     * Sets whether the rotation gesture is enabled or not.
     */
    public void setRotationEnabled(boolean enabled) {
        if (!ListenerUtil.mutListener.listen(7848)) {
            mIsRotationEnabled = enabled;
        }
    }

    /**
     * Gets whether the rotation gesture is enabled or not.
     */
